import React from "react";
//Hook

const FreeBoardLists = ({ posts, loading }) => {
  //console.log(posts);

  return (
    <>
      {loading && <div> loading... </div>}
      <div className="max-w-480 ">
        {posts.map((post) => (
          <>
            <div className="h-28 p-4 border-b" key={post.id}>
              <h2 className="text-base truncate">{post.title}</h2>
              <p className="text-sm text-gray-400 line-clamp-2">{post.body}</p>
            </div>
            <div className="flex justify-between text-xs">
              <div>
                <span className="text-gray-400">00/00/00</span>
                <span>{`유저 ${post.userId}`}</span>
              </div>
            </div>
          </>
        ))}
      </div>
    </>
  );
};

export default FreeBoardLists;
